public class Main {
    public static void main(String[] args) {
        Student[] stu = new Student[2];
        stu[0] = new Student("张三", 18, "男");
        stu[1] = new Student();
        stu[1].setName("李四");
        stu[1].setAge(19);
        stu[1].setSex("女");
        for (int i = 0; i < stu.length; i++) {
            System.out.println(stu[i]);
        }
        Student[][] s = new Student[3][];
        s[0] = new Student[2];
        s[0][0] = new Student("Tom", 80, "male");
        s[0][1] = new Student("Jerry", 80, "M");
        s[1] = new Student[1];
        s[1][0] = new Student();
        s[2] = new Student[3];
        s[2][0] = new Student("小王", 20, "F");
        s[2][1] = new Student("老赵", 21, "m");
        s[2][2] = new Student();
        s[2][2].setName("钱总");
        s[2][2].setAge(22);
        s[2][2].setSex("femal");
        for (int i = 0; i < s.length; i++) {
            for (int j = 0; j < s[i].length; j++) {
                System.out.println(s[i][j]);
            }
        }
    }
}

class Student {
    private String name;
    private int age;
    private String sex;

    public Student() {

    }

    public Student(String name, int age, String sex) {
        super();
        this.name = name;
        this.age = age;
        this.sex = sex;
    }

    @Override
    public String toString() {
        return "Student [name=" + name + ", age=" + age + ", sex=" + sex + "]";
    }

    public String getName() {
        return name;
    }

    public void setName(String name) {
        this.name = name;
    }

    public int getAge() {
        return age;
    }

    public void setAge(int age) {
        this.age = age;
    }

    public String getSex() {
        return sex;
    }

    public void setSex(String sex) {
        this.sex = sex;
    }
}
